    fun checkRoute(forms: ArrayList<ItemResponse>, uuid: String) {
        val route = Route()
        forms.forEach { form ->
            if (form.name != null) {
                form.name.english?.let {
                    route.form = it
                }
            }
            else{
                route.form = ""
            }

            if (uuid == form.id.trim() ) {
                println("found form"+form.name.english)
                flag = true
            }
            if(flag) {
                routes.add(route)
                return
            }
            form.items?.forEach { section ->

                section.name.english?.let{
                    route.formSection = it
                }
                if ( uuid == section.id.trim() ) {
                    println("found section"+section.name.english)
                    flag = true
                    if(flag) {
                        routes.add(route)
                        return
                    }

                }
                section.items?.forEach { item ->
                    item.name.english?.let{
                        route.formItem = it
                    }
                    if ( uuid == item.id.trim()) {
                        println("found item"+item.name.english)
                        flag = true
                    }
                    if(flag) {
                        routes.add(route)
                        return
                    }

                    if (item.items!= null && !flag) {
                        println(item.id)
                        step ++
                        checkRoute(item.items!!,uuid)
                    }
                }
            }
        }
    }
